import React from 'react';
import logo from './logo.svg';
import './App.css';
import ItemList from './Components/ItemList';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h2>Shopping Cart</h2>
      </header>
      <div id="itemList">
        <ItemList></ItemList>
          <ul>
            <li>Items Go Here</li>
          </ul>
        </div>

        <div id="cart">
          <div id="purchaseList">
            <ul>
              <li>Item #1 in cart</li>
            </ul>
          </div>
          <div id="totals">
            <p>$ 0.00</p>
          </div>
        </div>
    </div>
  );
}

export default App;
